  bindFeedbackEvent() {
    var _self:any = this;
    var payload:any = {
      requestId: null,
      query: null,
      contentId: null,
      contentType: null,
      feedbackType: null,
      userId: _self.API.uuid,
    };
    $(document)
      .off("click", ".faqs-shadow")
      .on("click", ".faqs-shadow", function (event: any) {
        var currentActiveEle = $(".accordion.acc-active").parent();
        payload.contentId = $(currentActiveEle).attr("contentid");
        payload.contentType = $(currentActiveEle).attr("contenttype");
        payload.requestId = _self.vars.previousSearchObj.requestId;
        payload.query = _self.vars.previousSearchObj.searchText;
      });
    $(document)
      .off("click", ".yesLike")
      .on("click", ".yesLike", function (event: { target: any; currentTarget: any; }) {
        $(event.target).toggleClass("icon-active");
        if ($(event.target).hasClass("icon-active")) {
          $(event.target).attr(
            "src",
            "data:image/svg+xml;base64,"
          );
          $(event.target)
            .parent()
            .next()
            .children()
            .attr(
              "src",
              "data:image/svg+xml;base64,"
            );
          payload.feedbackType = "thumbsup";

          if (_self.vars.showingMatchedResults == true) {
            //_self.captureClickAnalytics(event, $(event.target).closest('.title').attr('contenttype'), 'thumbsUp');
            _self.captureClickAnalytics(
              event,
              $(event.target).closest(".faqs-shadow").attr("contenttype"),
              "thumbsUp",
              $(event.currentTarget).closest(".faqs-shadow").attr("contentId"),
              $(event.currentTarget).closest(".faqs-shadow").attr("id"),
              $(event.currentTarget).closest(".accordion").text()
            );
          }

          _self
            .newSearchFeedbackPost(
              _self.API.newSearchFeedbackUrl,
              "POST",
              payload
            )
            .then(function (res: any) { });
        } else {
          $(event.target).attr(
            "src",
            "data:image/svg+xml;base64,"
          );
        }
      });
    $(document)
      .off("click", ".noDislike")
      .on("click", ".noDislike", function (event: { target: any; currentTarget: any; }) {
        $(event.target).toggleClass("icon-active");
        if ($(event.target).hasClass("icon-active")) {
          $(event.target).attr(
            "src",
            "data:image/svg+xml;base64,"
          );
          $(event.target)
            .parent()
            .prev()
            .children()
            .attr(
              "src",
              "data:image/svg+xml;base64,"
            );
          payload.feedbackType = "thumbsdown";

          if (_self.vars.showingMatchedResults == true) {
            _self.captureClickAnalytics(
              event,
              $(event.target).closest(".faqs-shadow").attr("contenttype"),
              "thumbsDown",
              $(event.currentTarget).closest(".faqs-shadow").attr("contentId"),
              $(event.currentTarget).closest(".faqs-shadow").attr("id"),
              $(event.currentTarget).closest(".accordion").text()
            );
          }

          _self
            .newSearchFeedbackPost(
              _self.API.newSearchFeedbackUrl,
              "POST",
              payload
            )
            .then(function (res: any) { });
        } else {
          $(event.target).attr(
            "src",
            "data:image/svg+xml;base64,"
          );
        }
      });
  };

  getFacetsAsArray(facetsObj: { [x: string]: any; } | undefined) {
    var _self :any = this;
    var facets: { key: string; value: any; }[] = [];
    if (facetsObj) {
      Object.keys(facetsObj).forEach((facet) => {
        facets.push({ key: facet, value: facetsObj[facet] });
      });
    }
    return facets;
  };

