  refreshWidgetData(
    widgetData: any,
    time: number,
    panelDetail: { panel: string; }
  ) {
    var _self :any = this;
    var currTime:any = new Date().getTime();
    var givenTime:any = new Date().getTime() + 1000 * time;
    givenTime = parseInt(givenTime);
    if (
      $(_self.config.container.content)
        .find(".mainTemplateCntr#" + panelDetail.panel)
        .is(":visible") &&
      currTime < givenTime
    ) {
      _self.startWidgetPolling(widgetData, currTime, givenTime, panelDetail);
    } else {
      clearInterval(widgetData.pollingTimer);
    }
  };
  clearWidgetPolling(widgetData: { pollingTimer: NodeJS.Timeout; } | undefined) {
    var _self :any = this;
    if (widgetData) {
      clearInterval(widgetData.pollingTimer);
    } else {
      if (
        _self.vars.initialWidgetData &&
        _self.vars.initialWidgetData.panels &&
        _self.vars.initialWidgetData.panels.length
      ) {
        for (var i = 0; i < _self.vars.initialWidgetData.panels.length; i++) {
          //todo: deviation :adding "id" from "_id"
          if (
            _self.vars.initialWidgetData.panels[i].widgets &&
            _self.vars.initialWidgetData.panels[i].widgets.length
          ) {
            _self.vars.initialWidgetData.panels[i].widgets.forEach(function (
              widget: { pollingTimer: NodeJS.Timeout; }
            ) {
              if (widget.pollingTimer) {
                clearInterval(widget.pollingTimer);
              }
            });
          } //todo: deviation :added fallback icon for panels
        }
      }
    }
  };
  startWidgetPolling(
    widgetData: any,
    currTime: number,
    givenTime: any,
    panelDetail: any
  ) {
    var _self :any = this;
    widgetData.pollingTimer = setInterval(function () {
      currTime = currTime + 5000;
      if (givenTime < currTime) {
        clearInterval(widgetData);
        var panelDetailsString = JSON.stringify(panelDetail);
        _self.refreshElement(panelDetailsString, false, widgetData);
      }
    }, 5000);
  };
  refreshData(panelName: string, time: number) {
    var _self :any = this;

    var currTime = new Date().getTime();
    var givenTime:any = new Date().getTime() + 1000 * time;
    givenTime = parseInt(givenTime);

    if (
      $(_self.config.container.content)
        .find(".mainTemplateCntr#" + panelName)
        .is(":visible") &&
      currTime < givenTime
    ) {
      _self.startPolling(panelName, currTime, givenTime);
    } else {
      clearInterval(pollingTimer);

      if (meetingTimeRef.length > 0) {
        for (var k = 0; k < meetingTimeRef.length; k++) {
          clearInterval(meetingTimeRef[k]);
        }
      }
    }
  };

  startPolling(panelName: any, currTime: number, givenTime: number) {
    var _self :any = this;

    pollingTimer = setInterval(function () {
      currTime = currTime + 5000;

      if (givenTime < currTime) {
        clearInterval(pollingTimer);

        if (meetingTimeRef.length > 0) {
          for (var k = 0; k < meetingTimeRef.length; k++) {
            clearInterval(meetingTimeRef[k]);
          }
        }

        meetingTimeRef = [];

        _self.prepareRenderData(panelName, false);
      }
    }, 5000);
  };

