  getMeetingSlot(duration: { start: string | number | Date; end: string | number | Date; }) {
    var _self :any = this;

    var slots = [];
    var myStart = new Date(duration.start);
    var myEnd = new Date(duration.end);
  var  days = _self.getDateArray(myStart, myEnd);
  var  day = days.length - 1;

    if (day < 1) {
      return (slots = [
        {
          start: duration.start,
          end: duration.end,
        },
      ]);
    } else {
      var start = duration.start;
      var end = duration.end;

      for (var _i = 0; _i <= day; _i++) {
        var startDate = new Date(start);
        var endDate = new Date(end);

        if (_i > 0) {
          startDate.setDate(startDate.getDate() + _i);
          var tempStartDate = startDate;
          startDate = new Date(
            tempStartDate.getFullYear(),
            tempStartDate.getMonth(),
            tempStartDate.getDate(),
            0,
            0,
            0
          ); // 2013-07-30 23:59:59
        }

        var endOfDay:any = "";

        if (_i === day) {
          endOfDay = endDate;
        } else {
          endOfDay = new Date(
            startDate.getFullYear(),
            startDate.getMonth(),
            startDate.getDate(),
            23,
            59,
            0
          ); // 2013-07-30 23:59:59
        }

        var today = new Date();
        var localStarttime = new Date(startDate); // if (today.getFullYear() <= localStarttime.getFullYear() && today.getMonth() <= localStarttime.getMonth() && today.getDate() <= localStarttime.getDate())

        slots.push({
          start: new Date(startDate).getTime(),
          end: new Date(endOfDay).getTime(),
        });
      }

      return slots;
    }
  };

  getDateArray(start: string | number | Date, end: number | Date) {
    var arr = new Array(),
      dt = new Date(start);

    while (dt <= end) {
      arr.push(new Date(dt));
      dt.setDate(dt.getDate() + 1);
    }

    return arr;
  };

  cloneMessage1(obj: any) {
    var _self :any = this;

    var rv;

    switch (_typeof(obj)) {
      case "object":
        if (obj === null) {
          rv = null;
        } else {
          switch (toString.call(obj)) {
            case "[object Array]":
              rv = obj.map(_self.cloneMessage1.bind(_self));
              break;

            case "[object Date]":
              rv = new Date(obj);
              break;

            case "[object RegExp]":
              rv = new RegExp(obj);
              break;

            default:
              rv = Object.keys(obj).reduce(function (prev:any, key:any) {
                prev[key] = _self.cloneMessage1(obj[key]);
                return prev;
              }, {});
              break;
          }
        }

        break;

      default:
        rv = obj;
        break;
    }

    return rv;
  };

  compare(a: { data: { duration: { start: any; }; }; }, b: { data: { duration: { start: any; }; }; }) {
    var startFirst = a.data.duration.start;
    var startSecond = b.data.duration.start;
    var comparison = 0;

    if (startFirst > startSecond) {
      comparison = 1;
    } else if (startFirst < startSecond) {
      comparison = -1;
    }

    return comparison;
  };

