                      if (d.fieldName === _fieldName) {
                        let index = _self.vars.selectedFiltersArr.indexOf(d.id);
                        _self.vars.selectedFiltersArr.splice(index, 1);
                        _self.vars.selectedFacetsList.splice(index, 1);
                      }
