  searchFacetsList(selectedFacetsList: never[]) {
    var _self :any = this;
    var dataHTML = $(_self.getSelectedFactedListTopDownTemplate()).tmplProxy({
      selectedFacets: selectedFacetsList,
      isTopFacets:
        (_self.vars.filterConfiguration || {}).aligned === "top" ? true : false,
    });
    $("#show-filters-added-data").empty().append(dataHTML);
    if ((selectedFacetsList || []).length) {
      $("#show-filters-added-data").show();
      $("#show-filters-added-data").removeClass("display-none");
      $(".content-data-sec").addClass("filter-added");
    } else {
      _self.vars.selectedFiltersArr = [];
      _self.vars.filterObject = [];
      $("#show-filters-added-data").hide();
      $("#show-filters-added-data").addClass("display-none");
      $(".content-data-sec").removeClass("filter-added");
    }

    if ($("#show-filters-added-data").height() > 55) {
      $(".content-data-sec").addClass("facets-height-isMore");
    } else {
      $(".content-data-sec").removeClass("facets-height-isMore");
    }
  };
  sdkFiltersCheckboxClick() {
    var _self:any = this;

    $(".sdk-filter-checkbox-top-down")
      .off("change")
      .on("change", function (event: any) {
        _self.vars.isTopFacets =
          _self.vars.filterConfiguration.aligned === "top" ? true : false;
        if (
          $(".topdown-search-main-container").length &&
          !_self.vars.isTopFacets
        ) {
          // $('#loaderDIV').show();
        }

        if ($(event.currentTarget).is(":checked")) {
          _self.vars.selectedFiltersArr.push($(event.currentTarget).attr("id"));
          /* top -down -search -experience -start */
          _self.vars.selectedFacetsList.push({
            id: $(event.currentTarget).attr("id"),
            name: $(event.currentTarget).attr("name"),
            fieldName: $(event.currentTarget).attr("fieldName"),
            fieldType: $(event.currentTarget).attr("fieldType"),
          });
          /* top -down -search -experience -end*/
          _self.vars.countOfSelectedFilters += 1;
          _self.filterResultsTopDown(event, true, false, _self.vars.isTopFacets);
        } else {
          var unselectedFilterID = $(event.currentTarget).attr("id");
          _self.vars.selectedFiltersArr.slice(0).forEach(function (filter: any) {
            if (filter == unselectedFilterID) {
              var index = _self.vars.selectedFiltersArr.indexOf(filter);
              _self.vars.selectedFiltersArr.splice(index, 1);
              /* top -down -search -experience -start */
              _self.vars.selectedFacetsList.splice(index, 1);
              /* top -down -search -experience -end */
            }
          });

          _self.vars.countOfSelectedFilters -= 1;

          _self.filterResultsTopDown(event, false, false, _self.vars.isTopFacets);
        }
        //top-down-search-facets-list-start//
        if (
          $(".topdown-search-main-container").length &&
          !_self.vars.isTopFacets
        ) {
          _self.getTopDownFacetsAddedList();
        }
        //top-down-search-facets-list-end//
      });
    $(".sdk-filter-radio-top-down")
      .off("change")
      .on("change", function (event: any) {
        event.stopImmediatePropagation();
        $("#loaderDIV").show();

        // if(_self.vars['selectedFiltersRadio']){
        //   _self.vars['selectedFiltersRadio'].push($(this).attr("id"));
        // }
        if (_self.vars.selectedFacetsList.length) {
          var facetIndex = _self.vars.selectedFacetsList.findIndex(
            (x: { name: any; }) => x.name === $(event.currentTarget).attr("name")
          );
          if (facetIndex > -1) {
            _self.vars.selectedFiltersArr.splice(
              facetIndex,
              1,
              $(event.currentTarget).attr("id")
            );
            _self.vars.selectedFacetsList.splice(facetIndex, 1, {
              id: $(event.currentTarget).attr("id"),
              name: $(event.currentTarget).attr("name"),
              value: $(event.currentTarget).attr("value"),
              fieldName: $(event.currentTarget).attr("fieldName"),
              fieldType: $(event.currentTarget).attr("fieldType"),
            });
            _self.filterResultsTopDown(event, false);
          } else {
            _self.vars.selectedFiltersArr.push($(event.currentTarget).attr("id"));
            _self.vars.selectedFacetsList.push({
              id: $(event.currentTarget).attr("id"),
              value: $(event.currentTarget).attr("value"),
              name: $(event.currentTarget).attr("name"),
              fieldName: $(event.currentTarget).attr("fieldName"),
              fieldType: $(event.currentTarget).attr("fieldType"),
            });
            _self.vars.countOfSelectedFilters += 1;
            _self.filterResultsTopDown(event, true);
          }
        } else {
          _self.vars.selectedFiltersArr.push($(event.currentTarget).attr("id"));
          _self.vars.selectedFacetsList.push({
            id: $(event.currentTarget).attr("id"),
            value: $(event.currentTarget).attr("value"),
            name: $(event.currentTarget).attr("name"),
            fieldName: $(event.currentTarget).attr("fieldName"),
            fieldType: $(event.currentTarget).attr("fieldType"),
          });
          _self.vars.countOfSelectedFilters += 1;
          _self.filterResultsTopDown(event, true);
        }
        if ($(".topdown-search-main-container").length) {
          _self.getTopDownFacetsAddedList(true);
        }
      });
  };

  facetsAlignTopdownClass(type: string) {
    if (type === "top") {
      // center align facets top down//
      $(".all-result-container").addClass("center-align-filter");
      $(".all-result-container").removeClass("left-align-filter");
      $(".all-result-container").removeClass("right-align-filter");
      //center align facets top down//
    } else {
      // left align facets top down//
      $(".all-result-container").addClass("left-align-filter");
      $(".all-result-container").removeClass("center-align-filter");
      $(".all-result-container").removeClass("right-align-filter");
      //left align facets top down//
    }
  };
