  configureSearchInterface(botOptions: { koreAPIUrl: any; botInfo: { taskBotId: string; }; searchIndexID: string; assertion: any; }) {
    var baseAPIServer = botOptions.koreAPIUrl
      ? botOptions.koreAPIUrl
      : "https://qa.searchassist.ai/searchassistapi/";
    var searchExperienceAPIUrl =
      baseAPIServer +
      "searchsdk/stream/" +
      botOptions.botInfo.taskBotId +
      "/" +
      botOptions.searchIndexID +
      "/searchInterface";
    var type = "GET";

    return $.ajax({
      url: searchExperienceAPIUrl,
      type: type,
      headers: {
        auth: botOptions.assertion,
      },
      data: {},
      success: function (data: any) { },
      error: function (err: any) { },
    });
  };

