  rearrangeTabsList(facets: any[]) {
    var _self :any = this;
    var rearrangeList = [];
    if (_self.vars.defaultTabsList.length) {
      var allResultObj = facets.find((t: { key: string; }) => t.key === "all results");
      if (allResultObj) {
        rearrangeList.push(allResultObj);
      }
      _self.vars.defaultTabsList.forEach((tab: { fieldValue: any; }) => {
        var facetObj = facets.find((t: { key: any; }) => t.key === tab.fieldValue);
        if (facetObj) {
          rearrangeList.push(facetObj);
        }
      });
    } else {
      rearrangeList = facets;
    }
    return rearrangeList;
  };
